export const info = vm => {
  const desc =
    (vm.isSimple
      ? '解锁当前模块，享受更多服务。'
      : '解锁以下模块，享受更强大的管理服务。') + '开通热线：400-962-8988'
  return {
    title: '升级到高级版',
    desc,
    banner:
      'https://styd-frontend.oss-cn-shanghai.aliyuncs.com/images/saas-pro/version-modules/module-banner.png',
    moduleList: [
      {
        icon:
          'https://styd-frontend.oss-cn-shanghai.aliyuncs.com/images/saas-pro/version-modules/module-staff.png',
        title: '员工管理',
        desc: '更多的员工数量'
      },
      {
        icon:
          'https://styd-frontend.oss-cn-shanghai.aliyuncs.com/images/saas-pro/version-modules/module-cabinet.png',
        title: '储物柜',
        desc: '临时柜、租赁柜管理'
      },
      {
        icon:
          'https://styd-frontend.oss-cn-shanghai.aliyuncs.com/images/saas-pro/version-modules/module-stat.png',
        title: '数据分析',
        desc: '订单报表、收银报表'
      },
      {
        icon:
          'https://styd-frontend.oss-cn-shanghai.aliyuncs.com/images/saas-pro/version-modules/module-mina.png',
        title: '小程序装修',
        desc: '首页高度自定义'
      },
      {
        icon:
          'https://styd-frontend.oss-cn-shanghai.aliyuncs.com/images/saas-pro/version-modules/module-deposit.png',
        title: '押金管理',
        desc: '押金模块'
      },
      {
        icon:
          'https://styd-frontend.oss-cn-shanghai.aliyuncs.com/images/saas-pro/version-modules/module-more.png',
        title: '',
        desc: '更多服务<br/>敬请期待'
      }
    ]
  }
}
